DROP TABLE IF EXISTS `cy_coupon`;
CREATE TABLE `cy_coupon` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `money` double(10,2) DEFAULT NULL COMMENT '优惠卷金额',
  `count` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '张数',
  `out_count` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '已领张数',
  `out_role` int(11) DEFAULT NULL COMMENT '1按消费金额从高到低|2按消费金额从低到高|3按积分从高到低|4按积分从高到低',
  `valid_start` int(11) DEFAULT NULL COMMENT '有效期开始',
  `valid_end` int(11) DEFAULT NULL COMMENT '有效期结束',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  `odds` decimal(4,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '中奖几率',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=52 DEFAULT CHARSET=utf8 COMMENT='优惠卷表';

