DROP TABLE IF EXISTS `cy_opinion`;
CREATE TABLE `cy_opinion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT NULL COMMENT '用户id',
  `opinion_type_id` int(11) DEFAULT NULL COMMENT '反馈类型id',
  `detail` varchar(255) DEFAULT NULL COMMENT '反馈详情',
  `images` text COMMENT '意见图片',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '0待处理1不予处理2已处理',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '反馈时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '意见图片',
  `delete_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='意见反馈记录表';

