DROP TABLE IF EXISTS `cy_order`;
CREATE TABLE `cy_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL COMMENT '用户id',
  `tel` varchar(20) NOT NULL DEFAULT '' COMMENT '留的电话',
  `order_sn` varchar(50) NOT NULL COMMENT '订单编号',
  `order_price` double(10,2) unsigned NOT NULL COMMENT '订单价格',
  `type` int(1) DEFAULT '0' COMMENT '订单类型：0堂吃订单|1外卖订单',
  `status` int(1) NOT NULL DEFAULT '10' COMMENT '订单状态  10未付款 11取消订单 12 退款中 13 退款成功  外卖：0待接单 1待派送 2已派送 3待评论 4已完成          堂吃：0待处理 1待评论 2已完成',
  `packaging_fee` double(10,2) DEFAULT '0.00' COMMENT '包装费',
  `delivery_fee` double(10,2) DEFAULT '0.00' COMMENT '配送费',
  `new_fee` double(10,2) DEFAULT '0.00' COMMENT '新用户立减费',
  `over_fee` double(10,2) DEFAULT '0.00' COMMENT '满减优惠',
  `coupon` double(10,2) DEFAULT '0.00' COMMENT '优惠金额',
  `coupon_get_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券id',
  `discount` double(10,2) DEFAULT '0.00' COMMENT '折扣商品',
  `address_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货地址ID',
  `pay_type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '支付类型：1-支付宝，2-微信，3-财富通',
  `seat_num` varchar(30) NOT NULL DEFAULT '' COMMENT '座位号',
  `delete_time` int(11) DEFAULT NULL,
  `address` varchar(200) NOT NULL COMMENT '地址',
  `update_time` int(11) DEFAULT NULL,
  `create_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=451 DEFAULT CHARSET=utf8 COMMENT='订单表';

