#
# Structure for table "cy_reserve"
#

DROP TABLE IF EXISTS `cy_reserve`;
CREATE TABLE `cy_reserve` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `order_sn` varchar(32) DEFAULT NULL COMMENT '订单编号',
  `num` int(11) DEFAULT NULL COMMENT '就餐人数',
  `time` int(11) DEFAULT NULL COMMENT '就餐时间',
  `name` varchar(30) DEFAULT NULL COMMENT '姓名',
  `is_room` enum('N','Y') NOT NULL DEFAULT 'N' COMMENT '是否预定包间：y-是，N-否',
  `sex` int(1) NOT NULL DEFAULT '0' COMMENT '0不详1男2女',
  `mobile` varchar(11) DEFAULT NULL COMMENT '电话',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '0未到时间1按时赴约2失约3取消预订',
  `des` varchar(255) DEFAULT NULL COMMENT '备注',
  `arrive_time` int(11) DEFAULT NULL COMMENT '到达时间',
  `create_time` int(11) DEFAULT NULL COMMENT '预定时间',
  `update_time` int(11) DEFAULT NULL,
  `delete_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=48 DEFAULT CHARSET=utf8 COMMENT='预定表';

