#
# Procedure "test1"
#

DROP PROCEDURE IF EXISTS `test1`;
CREATE PROCEDURE `test1`()
BEGIN
	UPDATE cy_reserve SET `status`=2 WHERE `time`<unix_timestamp(now()) AND `status`=0;
END;
